import React from 'react'
import background from '../assets/background.jpeg'
import { useNavigate } from 'react-router-dom';

const Home = () => {
  const navigate = useNavigate();

  const handleSearchClick = () => {
    // Navigate to the BookSearchPage component when search button is clicked
    navigate('/booksearch');
  };

  return (
    <div >
      <img src={background} alt="bk"></img>
      <h1 text-3xl align-center>Welcome to the Home Page!</h1>


      <button onClick={handleSearchClick}>Search Books</button>
    </div>
  );
};

export default Home;
